import "./HomeSection.css";
import "../App.css";

function HomeSection() {
  return (
    <>
      <div className="container">
        <div className="review-box">
          <h2>"best reading ever" - customer</h2>
        </div>
      </div>
    </>
  );
}

export default HomeSection;
